import React from "react"
import { Redirect } from 'react-router-dom';

function App(){
     
    const Goto = function() {
        return <Redirect to="/forms"/>
    }
    return(
        <div>
            <button onClick={Goto}>Enter the Data</button>
        </div>
    )
}

export default App
